import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Header from "./components/header";
import NavBar from "./components/navbar";
import Particles from "react-particles-js";
function App() {
  return (
    <div className="App">
      <Particles
        params={{
          particles: {
            number: {
              value: 30,
              density: {
                enable: true,
              },
            },
          },
        }}
      />
      <NavBar />
      <Header />
    </div>
  );
}

export default App;
